void external_irq_callback (void)
{
WM_HWIN hWin;
WM_HWIN hItem;
    hWin = WM_GetActiveWindow();
  hItem = WM_GetDialogItem(hWin, ID_BUTTON_00);
  WIDGET_SetFocusable(hItem,1);
  WM_SetFocus(hItem);
  GUI_StoreKeyMsg(GUI_KEY_ENTER, 1); /* Pressed */
  GUI_StoreKeyMsg(GUI_KEY_ENTER, 0); /* Release */
}
